import React, { useEffect, useState } from "react";
import { useParams, Link, useNavigate } from "react-router-dom";

const CourseStudents = () => {
  const { courseId } = useParams();
  const navigate = useNavigate();
  const [course, setCourse] = useState(null);
  const [students, setStudents] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        setIsLoading(true);
        setError(null);

        // Fetch course and students in parallel
        const [courseRes, studentsRes] = await Promise.all([
          fetch(`http://localhost:5000/courses/${courseId}`),
          fetch(`http://localhost:5000/courses/${courseId}/students`),
        ]);

        if (!courseRes.ok) throw new Error("Course not found");
        if (!studentsRes.ok) throw new Error("Failed to load students");

        const [courseData, studentsData] = await Promise.all([
          courseRes.json(),
          studentsRes.json(),
        ]);

        setCourse(courseData);
        setStudents(studentsData);
      } catch (err) {
        setError(err.message);
        console.error("Error:", err);
      } finally {
        setIsLoading(false);
      }
    };

    fetchData();
  }, [courseId]);

  if (isLoading) {
    return (
      <div style={styles.loadingContainer}>
        <div style={styles.spinner}></div>
        <p>Loading enrolled students...</p>
      </div>
    );
  }

  if (error) {
    return (
      <div style={styles.container}>
        <h2 style={styles.error}>{error}</h2>
        <button onClick={() => navigate("/courses")} style={styles.backButton}>
          ← Back to Courses
        </button>
      </div>
    );
  }

  return (
    <div style={styles.container}>
      <div style={styles.header}>
        <h2 style={styles.heading}>Students Enrolled in {course.name}</h2>
        <p style={styles.subHeading}>{course.description}</p>
        <p style={styles.enrollmentCount}>
          Total enrolled: {students.length} students
        </p>
      </div>

      <button onClick={() => navigate("/courses")} style={styles.backButton}>
        ← Back to Courses
      </button>

      {students.length === 0 ? (
        <div style={styles.emptyState}>
          <p style={styles.emptyText}>
            No students enrolled in this course yet
          </p>
        </div>
      ) : (
        <div style={styles.cardGrid}>
          {students.map((student) => (
            <div key={student._id} style={styles.card}>
              <h3 style={styles.studentName}>{student.name}</h3>
              <p style={styles.studentEmail}>{student.email}</p>
              <button
                onClick={() => navigate(`/students/${student._id}`)}
                style={styles.viewButton}
              >
                View Details
              </button>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

const styles = {
  container: {
    maxWidth: "1200px",
    margin: "0 auto",
    padding: "2rem",
    fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
  },
  header: {
    textAlign: "center",
    marginBottom: "2rem",
  },
  heading: {
    fontSize: "2rem",
    fontWeight: "600",
    color: "#2c3e50",
    marginBottom: "0.5rem",
  },
  subHeading: {
    fontSize: "1rem",
    color: "#7f8c8d",
    marginBottom: "0.5rem",
  },
  enrollmentCount: {
    fontSize: "0.9rem",
    color: "#3498db",
    fontWeight: "500",
    marginBottom: "1.5rem",
  },
  backButton: {
    backgroundColor: "#f8f9fa",
    color: "#3498db",
    border: "none",
    padding: "0.5rem 1rem",
    borderRadius: "4px",
    cursor: "pointer",
    fontSize: "0.9rem",
    fontWeight: "500",
    marginBottom: "2rem",
    display: "inline-block",
    ":hover": {
      backgroundColor: "#e9ecef",
    },
  },
  cardGrid: {
    display: "grid",
    gridTemplateColumns: "repeat(auto-fill, minmax(280px, 1fr))",
    gap: "1.5rem",
  },
  card: {
    backgroundColor: "white",
    borderRadius: "8px",
    padding: "1.5rem",
    boxShadow: "0 2px 8px rgba(0, 0, 0, 0.1)",
    transition: "transform 0.2s",
    ":hover": {
      transform: "translateY(-2px)",
    },
  },
  studentName: {
    fontSize: "1.1rem",
    fontWeight: "600",
    marginBottom: "0.5rem",
    color: "#2c3e50",
  },
  studentEmail: {
    color: "#7f8c8d",
    marginBottom: "1rem",
    fontSize: "0.9rem",
  },
  viewButton: {
    backgroundColor: "#3498db",
    color: "white",
    border: "none",
    padding: "0.5rem 1rem",
    borderRadius: "4px",
    cursor: "pointer",
    fontSize: "0.9rem",
    ":hover": {
      backgroundColor: "#2980b9",
    },
  },
  loadingContainer: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    height: "100vh",
  },
  spinner: {
    border: "4px solid rgba(0, 0, 0, 0.1)",
    borderLeftColor: "#3498db",
    borderRadius: "50%",
    width: "40px",
    height: "40px",
    animation: "spin 1s linear infinite",
    marginBottom: "1rem",
  },
  emptyState: {
    backgroundColor: "white",
    padding: "3rem",
    borderRadius: "8px",
    textAlign: "center",
    boxShadow: "0 2px 8px rgba(0, 0, 0, 0.1)",
    marginTop: "2rem",
  },
  emptyText: {
    fontSize: "1.1rem",
    color: "#7f8c8d",
  },
  error: {
    color: "#e74c3c",
    textAlign: "center",
    margin: "2rem 0",
  },
};

export default CourseStudents;
